
public class qaclass08 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int Ten = 10;	
		int Twenty = 20;
		int Thirty = 30;
		
		//System.out.println(Twenty>>Thirty); 
		System.out.println(Twenty>Thirty); 
		System.out.println(Twenty<Thirty);
		System.out.println(Twenty>=Thirty);
		System.out.println(Twenty<=Thirty);
		
		
		System.out.println(Twenty==Thirty);
		System.out.println(Twenty!=Thirty);

	}

}
